import React from "react";
import AllContext from "./all-context.js";

const AllContextValue = {
  access_token: null,
};

const AddContextProvider = (props) => {
  return (
    <AllContext.Provider value={AllContextValue}>
      {props.children}
    </AllContext.Provider>
  );
};

export default AddContextProvider;
